type SecondaryTeacher = {
  name: string;
  subject: string;
  hours: {
    [day: string]: { "3ème": number; Tle: number };
    total: { "3ème": number; Tle: number };
  };
  rates: { "3ème": number; Tle: number };
  amount: { "3ème": number; Tle: number; total: number };
  paid: boolean;
  school?: string; // only used for aggregation
};

type UserInfo = {
  ifu: string;
  name: string;
  amount: number;
  account: string;
};

type School = {
  secondaryTeachers: SecondaryTeacher[];
};

type Bank = {
  schools: { [schoolName: string]: School };
};

const dedicace = "@TEAAZ";

function addTheSignatureUnderPage(iPage: number, tPages: number): string {
  let signature = "MCOT - DAAF-DSI - IMPRIMÉ LE ";
  const today = new Date().toLocaleDateString('fr-BJ', { day: '2-digit', month: '2-digit', year: 'numeric' });

  signature = signature + today;
  signature = signature + " - PAGE ";
  signature = signature + `${(iPage < 10 && tPages >= 10) ? `0${iPage}` : `${iPage}`}`;
  signature = signature + " sur ";
  signature = signature + `${tPages}`;
  signature = signature + ` (${dedicace})`;

  return signature;
};

function numberToFrenchWords(n: number): string {
  if (!Number.isInteger(n) || n < 0 || n > 999_999_999_999) {
    return "Nombre non pris en charge";
  }

  const units = ["zéro", "un", "deux", "trois", "quatre", "cinq", "six", "sept", "huit", "neuf"];
  const teens = ["dix", "onze", "douze", "treize", "quatorze", "quinze", "seize"];
  const tens = ["", "", "vingt", "trente", "quarante", "cinquante", "soixante"];

  function convertBelow100(n: number): string {
    if (n < 10) return units[n];
    if (n < 17) return teens[n - 10];
    if (n < 20) return "dix-" + units[n - 10];
    if (n < 70) {
      const ten = Math.floor(n / 10);
      const unit = n % 10;
      return tens[ten] + (unit === 1 ? "-et-un" : unit > 0 ? "-" + units[unit] : "");
    }
    if (n < 80) {
      if (n === 71) return "soixante-et-onze";
      return "soixante-" + convertBelow100(n - 60);
    }
    if (n < 100) {
      if (n === 81) return "quatre-vingt-un";
      if (n === 91) return "quatre-vingt-onze";
      return "quatre-vingt" + (n % 20 === 0 ? "s" : "-" + convertBelow100(n - 80));
    }
    return "";
  }

  function convertBelow1000(n: number): string {
    if (n < 100) return convertBelow100(n);
    const hundred = Math.floor(n / 100);
    const rest = n % 100;
    const hundredStr =
      hundred === 1 ? "cent" : units[hundred] + " cent" + (rest === 0 ? "s" : "");
    return rest > 0 ? hundredStr + " " + convertBelow100(rest) : hundredStr;
  }

  function convertChunk(n: number): string {
    if (n === 0) return "";
    return convertBelow1000(n);
  }

  const billion = Math.floor(n / 1_000_000_000);
  const million = Math.floor((n % 1_000_000_000) / 1_000_000);
  const thousand = Math.floor((n % 1_000_000) / 1000);
  const rest = n % 1000;

  let result = "";

  if (billion) {
    result += (billion === 1 ? "un milliard" : convertChunk(billion) + " milliards") + " ";
  }

  if (million) {
    result += (million === 1 ? "un million" : convertChunk(million) + " millions") + " ";
  }

  if (thousand) {
    result += (thousand === 1 ? "mille" : convertChunk(thousand) + " mille") + " ";
  }

  if (rest || (!billion && !million && !thousand)) {
    result += convertChunk(rest);
  }

  return result.trim();
};

function spaceNumber(nombreStr: string): string {
  if (!/^\d+$/.test(nombreStr)) {
    return nombreStr; // ou return 'Entrée invalide'
  }

  return nombreStr.replace(/\B(?=(\d{3})+(?!\d))/g, ' ');
};

function handleDownloadExcel(teachers: UserInfo[], selectedBank: string) {
  // Préparer les données de la feuille Excel
  const rows: any[] = [];

  // Entête de colonnes
  const headers = [
    'Nº IFU',
    'NOM ET PRÉNOMS',
    'MONTANT (en FCFA)',
    'Nº DE COMPTE',
  ];
  rows.push(headers);

  // Corps du tableau
  teachers.forEach((teacher) => {
    const row = [
      teacher.ifu,
      teacher.name,
      teacher.amount ?? 0,
      teacher.account,
    ];
    rows.push(row);
  });

  // Création de la feuille et du classeur
  const worksheet = XLSX.utils.aoa_to_sheet(rows);
  const workbook = XLSX.utils.book_new();
  XLSX.utils.book_append_sheet(workbook, worksheet, selectedBank || 'État de virement');

  // Générer le fichier Excel
  const excelBuffer = XLSX.write(workbook, { bookType: 'xlsx', type: 'array' });
  const blob = new Blob([excelBuffer], { type: 'application/octet-stream' });
  saveAs(blob, `etat_virement_${selectedBank}.xlsx`);
}

function justOrderNames(teachers: SecondaryTeacher[]) : SecondaryTeacher[] {
  teachers.sort((a, b) => a.name.toLowerCase().localeCompare(b.name.toLowerCase()));
  return teachers;
};

